import React, { useState, useEffect } from "react";
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
  } from "reactstrap";

const Nav_Bar = (props) => {
  return (
    <>
      <Navbar>
          <Link to="/entryform">Entry Form
          </Link>
      </Navbar>
    </>
  );
};

export default Nav_Bar;
